import { Component } from 'react';
import './App.css';
import NavBar from './components/NavBar';
import Home from './pages/Home';
import Contact from './pages/Contact';
import About from './pages/About';


function App() {
  let component
  switch (window.location.pathname) {
    case '/':
      Component = <Home />
      break
    case '/contact':
      Component = <Contact />
      break
    case '/about':
      Component = <About />
      break
  }
  return (
    <>
    <NavBar />
    <Component />
    </>
  );
}

export default App;
